def jaccard_similarity(array1, array2):
    total_similarity = 0
    for str1, str2 in zip(array1, array2):
        length = max(len(str1), len(str2))
        diff_count = sum(c1 != c2 for c1, c2 in zip(str1, str2))
        similarity_percentage = ((length - diff_count) / length) * 100
        #print(similarity_percentage)
        total_similarity += similarity_percentage

    average_similarity = total_similarity / len(array1)
    return average_similarity


